import React, { useRef } from "react";

export default function Test12() {
    // Create individual refs for each input field
    const firstnameRef = useRef(null);
    const lastnameRef = useRef(null);
    const ansRef = useRef(null);
    const cityRef = useRef(null);
    const checkboxRef = useRef(null);

    const handleref = (e) => {
        e.preventDefault();
        // Collect data from refs
        const value = {
            firstname: firstnameRef.current.value,
            lastname: lastnameRef.current.value,
            ans: ansRef.current.value,
            city: cityRef.current.value,
            checkbox: checkboxRef.current.checked,
        };
        console.log(value); // Do something with the collected data
    };

    return (
        <form>
            <div>
                <label htmlFor="firstname">Firstname</label>
                <input type="text" name="firstname" id="firstname" ref={firstnameRef} />
            </div>
            <div>
                <label htmlFor="lastname">Lastname</label>
                <input type="text" name="lastname" id="lastname" ref={lastnameRef} />
            </div>
            <div>
                <label htmlFor="ans">Age</label>
                <input type="text" name="ans" id="ans" ref={ansRef} />
            </div>
            <div>
                <label htmlFor="city">City</label>
                <input type="text" name="city" id="city" ref={cityRef} />
            </div>
            <div>
                <label htmlFor="checkbox">Checkbox</label>
                <input type="checkbox" name="checkbox" id="checkbox" ref={checkboxRef} />
            </div>
            <button type="submit" onClick={handleref}>Submit</button>
        </form>
    );
}
